import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/recent" element={<RecentChecks />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

function Navbar() {
  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="brand">PHISHING DETECTOR</Link>
        <div className="nav-links">
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/contact">Contact</Link>
          <Link to="/recent">Recent Checks</Link>
        </div>
      </div>
    </nav>
  );
}

function Home() {
  const [url, setUrl] = useState('');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const checkUrl = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const response = await axios.post('http://your-backend-api/check', { url });
      setResult(response.data);
      // Save to recent checks in localStorage
      const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');
      localStorage.setItem('recentChecks', JSON.stringify([...recent, response.data]));
    } catch (error) {
      console.error("Error checking URL:", error);
    }
    setLoading(false);
  };

  return (
    <div className="home">
      <h1>Phishing URL Detection</h1>
      <div className="card">
        <form onSubmit={checkUrl}>
          <input
            type="url"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
            placeholder="Enter URL to check..."
            required
          />
          <button type="submit" disabled={loading}>
            {loading ? 'Checking...' : 'Check URL'}
          </button>
        </form>

        {result && (
          <div className="result">
            <h3>Analysis Result</h3>
            <p>URL: <a href={result.url} target="_blank" rel="noopener noreferrer">{result.url}</a></p>
            <div className={`status ${result.is_phishing ? 'phishing' : 'safe'}`}>
              {result.is_phishing ? 'PHISHING DETECTED' : 'SAFE WEBSITE'}
            </div>
            <div className="progress-bar">
              <div 
                className="progress" 
                style={{ width: `${Math.round(result.probability * 100)}%` }}
              >
                {Math.round(result.probability * 100)}%
              </div>
            </div>
            <p>Checked on: {result.timestamp}</p>
          </div>
        )}
      </div>
    </div>
  );
}

function About() {
  return (
    <div className="about">
      <h1>About Us</h1>
      <div className="card">
        <h2>Our Mission</h2>
        <p>To protect internet users from phishing attacks...</p>
        {/* Add more content */}
      </div>
    </div>
  );
}

function Contact() {
  const [formData, setFormData] = useState({ name: '', email: '', message: '' });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    alert('Message sent!');
    setFormData({ name: '', email: '', message: '' });
  };

  return (
    <div className="contact">
      <h1>Contact Us</h1>
      <div className="card">
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            placeholder="Name"
            value={formData.name}
            onChange={(e) => setFormData({...formData, name: e.target.value})}
            required
          />
          <input
            type="email"
            placeholder="Email"
            value={formData.email}
            onChange={(e) => setFormData({...formData, email: e.target.value})}
            required
          />
          <textarea
            placeholder="Message"
            value={formData.message}
            onChange={(e) => setFormData({...formData, message: e.target.value})}
            required
          ></textarea>
          <button type="submit">Send Message</button>
        </form>
      </div>
    </div>
  );
}

function RecentChecks() {
  const [checks, setChecks] = useState([]);

  useEffect(() => {
    const recent = JSON.parse(localStorage.getItem('recentChecks') || '[]');
    setChecks(recent.slice(-10).reverse());
  }, []);

  return (
    <div className="recent">
      <h1>Recent Checks</h1>
      <div className="card">
        {checks.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>URL</th>
                <th>Status</th>
                <th>Risk</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {checks.map((check, index) => (
                <tr key={index}>
                  <td><a href={check.url} target="_blank" rel="noopener noreferrer">{check.url}</a></td>
                  <td><span className={`tag ${check.is_phishing ? 'phishing' : 'safe'}`}>
                    {check.is_phishing ? 'PHISHING' : 'SAFE'}
                  </span></td>
                  <td>
                    <div className="progress-bar">
                      <div 
                        className="progress" 
                        style={{ width: `${Math.round(check.probability * 100)}%` }}
                      >
                        {Math.round(check.probability * 100)}%
                      </div>
                    </div>
                  </td>
                  <td>{check.timestamp}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No recent checks found.</p>
        )}
      </div>
    </div>
  );
}

function Footer() {
  return (
    <footer>
      <p>Copyright &copy; {new Date().getFullYear()} PHISHING DETECTION WEBSITE. Designed by RACHEL BTECH IT.</p>
    </footer>
  );
}

export default App;
